  const displayInfo = () =>{
    console.log(name + salaire)
  }

  return (
    <div className="App">
      <div className='Information'> 

        <label> Nom employe</label>
        <input type="text"
          onChange={(event) =>{
            setName(event.target.value)
          }}>
        </input>

        <label> Salaire</label>
        <input type="number"
          onChange={(event) =>{
            setSalaire(event.target.value)
          }}>
        </input> 

        <button>Add</button>
      </div>
    </div>
  );
}


export default App;
